import React from "react";
import heroBackground from "../img/hero.png";

class Hero extends React.Component {
  render() {
    return (
      <section className="hero">
        <img src={heroBackground}></img>
        <div className="container"></div>
      </section>
    );
  }
}
export default Hero;
